import React from 'react';

export const Logo: React.FC = () => {
  return (
    <div className="flex items-center justify-center w-16 h-16 relative">
      {/* Ana kart */}
      <div className="absolute transform rotate-[-15deg] w-12 h-16 bg-gradient-to-br from-blue-400 to-blue-600 rounded-lg shadow-lg flex items-center justify-center border border-white/20">
        <span className="text-white font-bold text-2xl">8</span>
      </div>
      {/* Üst üste binmiş kart */}
      <div className="absolute transform rotate-[15deg] w-12 h-16 bg-gradient-to-br from-purple-400 to-purple-600 rounded-lg shadow-lg flex items-center justify-center border border-white/20">
        <span className="text-white font-bold text-2xl">13</span>
      </div>
      {/* En üstteki kart */}
      <div className="absolute w-12 h-16 bg-gradient-to-br from-indigo-400 to-indigo-600 rounded-lg shadow-lg flex items-center justify-center border-2 border-white">
        <span className="text-white font-bold text-2xl">5</span>
      </div>
      {/* Parlama efekti */}
      <div className="absolute inset-0 bg-white opacity-20 rounded-full blur-xl"></div>
    </div>
  );
};
